export const imgToBase64 = function(imageData: ImageData) {
    return toBase64(imageData.data)
}

export const toBase64 = function(data: ArrayLike<number>) {
    const u8 = Array.from(data)
    return btoa(String.fromCharCode.apply(null, u8));
}


export const fromBase64 = function (str) {
    return atob(str).split('').map(c => c.charCodeAt(0));
}

